    - type: Paper
      content: >-
        Добрый сосед атмос с прошлой смены передает привет!


        Так как данная станция окружена нормальной атмосферой, а газодобытчиков кроме плазмы нам и не установили, мной было принято решение соорудить свой газодобытчик на основе скрубберов!


        Вот только настроить я его не успел, срочно собрали на эвакуацию по неизвестным причинам, а потому пишу данное послание перед отлетом!


        Настройки камер достаточно простые!

        1) Подключите скрубберы к воздушной сигнализации своей камеры.

        2) Настройте фильтрацию скрубберов на кислород и азот соответственно.

        3) Наслаждайтесь стабильным потоком свежих газов прямиком из атмосферы!


        При желании вы даже можете подключить её к системе проложенной дистры, какой-то безумец проложил её по всей станции!!!

                           [italic]Приятной вам смены, от доброго соседа атмоса.[/italic]
