        8. Ты не хочешь победить в конкурсе самой красивой девушки в мире? Я готов стать твоим личным фанатом. 


        9. Ты не утомишься от внимания всех парней вокруг тебя? Позволь мне забрать тебя отсюда и устроить спасательную миссию. 


        10. Ты могла бы стать моим солнцем, потому что ты светишь ярче всех звезд на небесах.
